import React, { useEffect } from 'react'
import { ProductData } from './ProductsData';
import { useState } from 'react';
import { useParams } from 'react-router-dom';
import Header from './Header';
import Navbar from './Navbar';
export default function RecomForm() {
  let params=useParams();
  const data=ProductData;

  function aa(){
    const a=[];
    for (let i = 0; i < data.length; i++) {
        if(data[i].gender===params.gender.toString()){
          a.push(data[i]);
        }
    }
    const b=[];
    for(let i=0;i<a.length;i++){
      const b1=a[i].event;
      for(let j=0;j<b1.length;j++){
        if(b1[j]===params.event.toString()){
          b.push(a[i]);
        }
      }
    }

    const c=[];
    for(let i=0;i<b.length;i++){
      const c1=b[i].color;
      for(let j=0;j<c1.length;j++){
        if(c1[j]===params.color.toString()){
          c.push(b[i]);
        }
      }
    }

    const d=[];
    for(let i=0;i<c.length;i++){
      const d1=c[i].type;
      for(let j=0;j<d1.length;j++){
        if(d1[j]==params.type.toString()){
          d.push(c[i]);
        }
      }
    }

    return c;
  }
  let b=aa();


  return (
     <div>
      <Header />
      <Navbar />
      {params.gender.toString()}{params.type.toString}{params.color.toString}{params.event.toString}
       {b[0].gender}

     </div>
  );
}
